INSERT INTO `public_health_questions` VALUES (1,'Question 1','What other information do you need?  Where would you have looked to find that information? ',103),(2,'Question 2','What kind of other evidence-based information would you like to see regarding this case? Where would you have looked to find that kind of information?',103),(3,'Question 3','What other decision support tools do you need to make your decisions faster and/or more accurately?',103),(4,'Question 4','What would you have done differently if you had access to several similar patient charts? How would knowing how other patients were being treated help?',103),(5,'Question 5','What would you have done differently if the patient did not have neutropenia?',103),(6,'Question 6','What would you have done if the blood culture became resistant to Daptomycin?',103);
