INSERT INTO `tiu_document` VALUES (1,0,'description','2013-06-01 08:00:00','HISTORY:Patient was asked about alcohol use and said he was charged with a DUI two years ago and since then had \"drastically reduced\" his ETOH consumption.   Reported he occasionally drank after work, but denied any problems because of it.  His wife became angry and interjected at that point, saying that her husband was lying, that he drank nightly, and had been late to work several times in the past month due to hangovers.  His lateness was becoming a problem and his supervisor had given him a warning this past week.    Patient\'s wife said she was worried he would be written-up or fired if it happened again.   When I asked the patient if he had similar concerns about his drinking, he became tearful and said that he had tried to stop drinking, but each time he tried, he felt nauseated and shaky unless he had more to drink.  He said he hid a bottle of vodka in his garage and was lately drinking a shot or two before leaving for work each morning. He said that made it so he could get through the morning without shaking and throwing up.',1,'Doctor Who 1','Psych H&P - 1'),(2,0,'description','2007-01-01 10:00:00','HIST:Patient says he nearly hit someone on a jet ski while piloting a boat on an outing with friends a few weeks ago.  When questioned further, he said he had consumed \"three of four beers\" prior to the incident, but didn\'t think that had anything to do with the near miss.',1,'Doctor Who 1','Psychiatric History'),(3,0,'description','2005-10-01 03:00:00','HISTORY:When asked if he thought he might have a problem with alcohol, the patient said that, compared to his friends, he didn\'t think so.   He reported he could drink a 6-pack in a few hours without getting a buzz; something his friends couldn\'t do.  He said his friends often comment on how well he holds his liquor.',1,'Doctor Who 1','Psych H&P - 1  '),(4,0,'description','2005-10-01 03:00:00','HISTORY:When asked if he thought he might have a problem with alcohol, the patient said that, compared to his friends, he didn\'t think so.   He reported he could drink a 6-pack in a few hours without getting a buzz; something his friends couldn\'t do.  He said his friends often comment on how well he holds his liquor.',1,'Doctor Who 1','Psych H&P - 2  '),(5,0,'description','2012-07-01 18:00:00','Patient\'s favorite nephew wants him to attend his wedding next month.  Patient says he doesn\'t think he will go because he knows alcohol won\'t be served at the wedding reception due to the family\'s religious beliefs and doesn\'t want to go that long without a drink.  ',1,'Doctor Who 1','Physical Exam'),(6,0,'description','2002-06-01 08:00:00','HISTORY:Patient was asked about alcohol use and said he was charged with a DUI two years ago and since then had \"drastically reduced\" his ETOH consumption.   Reported he occasionally drank after work, but denied any problems because of it.  His wife became angry and interjected at that point, saying that her husband was lying, that he drank nightly, and had been late to work several times in the past month due to hangovers.  His lateness was becoming a problem and his supervisor had given him a warning this past week.    Patient\'s wife said she was worried he would be written-up or fired if it happened again.   When I asked the patient if he had similar concerns about his drinking, he became tearful and said that he had tried to stop drinking, but each time he tried, he felt nauseated and shaky unless he had more to drink.  He said he hid a bottle of vodka in his garage and was lately drinking a shot or two before leaving for work each morning. He said that made it so he could get through the morning without shaking and throwing up.',1,'Doctor Who 1','Psych H&P - 1'),(7,0,'description','2007-01-01 10:00:00','HIST:Patient says he nearly hit someone on a jet ski while piloting a boat on an outing with friends a few weeks ago.  When questioned further, he said he h